package ejercicioscasual;

public class ejercicio4 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int res;
		
		for (int i=1;i<=10;i++) {
			for(int j=1;j<=10;j++) {
				res=i*j;
				System.out.println(i+" x "+j+" = "+res);
			}
			System.out.println("");
		}
		
		
	}

}
